// src/App.js
import React from 'react';
import Login from './Login';
import Signup from './Signup';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (

    <>
      <BrowserRouter>
        <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />


    </Routes>

    <div>
      <Login />
      <hr />
      <Signup />
    </div>
    </BrowserRouter>
    </>
  );
}

export default App;
